import React from 'react'
import './textBox.css'

const Name = props=> {
    return (
        <div class={props.title}>
            <input class="form-control form-control-lg" type="text" placeholder="Enter company name"></input>
        </div>
    )
}

class Box extends React.Component {
    render() {
        return (
            <body>
                <h1>Slogify</h1>
                <h2>Advertising Made Easy</h2>
                <Name title="box"/>
                <div class="box">
                    <input class="form-control form-control-lg" type="text" placeholder="Enter company name"></input>
                </div>


            </body>
        )
    }
}

export default Box;
